import React from "react";
import "../css/homepage.css";
import Section_Image from "./pages/Section_Image";

const Homepage = () => {
  return (
    <div>


<BrowserRouter>
        <Switch>
          <Route path="/" exact>
            <Headers />
            <Homepage />
          </Route>
        </Switch>
      </BrowserRouter>


      
      <Section_Image />
    </div>
  );
};

export default Homepage;
